import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";


const TodoComp=(props)=>{
    return(
        <>
        <span>
            <DeleteIcon/>
        </span>
        <li>{props.val}</li>
        </>
    )
}

export default TodoComp
